func resultsArray(nums []int, k int) []int {
	// 加入数组的连续递增缓存 true 表示满足条件
	isIncCache := make([]bool, len(nums))
	isIncCache[0] = true
	for i := 1; i < len(nums); i++ {
		if nums[i]-nums[i-1] == 1 {
			isIncCache[i] = true
		} else {
			isIncCache[i] = false
		}
	}

	res := make([]int, 0)
	for i := 0; i <= len(nums)-k; i++ {

		// 当前如果最后一位 小于k 直接加 -1 跳转下一次
		if nums[i+k-1] < k {
			res = append(res, -1)
			continue
		} else if k == 1 {
			res = append(res, nums[i+k-1])
			continue
		}

		if i == 0 {
			// 第一次要全量判断
			if AndBool(isIncCache[i+1 : i+k]...) {
				res = append(res, nums[i+k-1])
			} else {
				res = append(res, -1)
			}
		} else {
			// 第二次往上判断前面的res 是否符合条件

			if isIncCache[i+k-1] && res[len(res)-1] != -1 {
				// 上次为递增 且 下一个位置也是递增 总体就是递增
				res = append(res, nums[i+k-1])
			} else if !isIncCache[i+k-1] {
				// 当前位数不满足 不用判断前面 也是不满足
				res = append(res, -1)
			} else {
				//全量判断
				if AndBool(isIncCache[i+1 : i+k]...) {
					res = append(res, nums[i+k-1])
				} else {
					res = append(res, -1)
				}
			}
		}
	}

	return res
}

func AndBool(flagValue ...bool) bool {
	var res bool
	res = flagValue[0]
	for _, v := range flagValue {
		res = res && v
	}

	return res
}

/*
官方解法

方法一：统计长度
思路与算法

本题与 「3254. 长度为 K 的子数组的能量值 I」同样的问题，根据题意可知，由于子数组如果满足连续上升，此时相邻元素的差值一定为 1，此时我们在遍历数组的同时，用一个计数器 cnt 统计以当前索引 i 为结尾时连续上升的元素个数，初始化 cnt=0，此时：

如果满足 i=0 或者 nums[i]−nums[i−1]=1 时，此时 cnt=cnt+1，即在 nums[i−1] 末尾可以追加元素 nums[i] 仍然满足连续上升；

nums[i]−nums[i−1]

=1 时，此时 cnt 重新置为 1，即在 nums[i−1] 末尾无法追加 nums[i]；

在计算的同时，此时如果以 nums[i] 为结尾的连续上升的元素数组如果大于等于 k，则当前一定存在长度为 k 且以 nums[i] 为结尾的连续上升的子数组，此时能量值即为 nums[i]；如果不满足，则无法构成长度为 k 且连续上升的子数组，则当前能量值为 −1，返回最终统计的能量值即可。
*/
func resultsArrayLeetCode(nums []int, k int) []int {
	n := len(nums)
	cnt := 0
	ans := make([]int, n-k+1)
	for i := 0; i < n; i++ {
		if i == 0 || nums[i]-nums[i-1] != 1 {
			cnt = 1
		} else {
			cnt++
		}
		if cnt >= k {
			ans[i-k+1] = nums[i]
		} else if i-k+1 >= 0 {
			ans[i-k+1] = -1
		}
	}
	return ans
}

